import React, { useEffect, useState } from 'react';
import axios from 'axios';


const FormUpdate = ({selectedEntry, setSelectedEntry, refreshList}) => {
    const url = "http://localhost:8000/api/entries/"
    //adding state to the functional component through useState React Hook
    const [state, setState] = useState({ 
        id: 0,
        name: '',
        email: '',
        select: '',
        shirtOption: '',
        raceOption: '',
        comments: '',
    });

    useEffect(() => {
        if(selectedEntry) {
            setState({
                id: selectedEntry.id,
                name: selectedEntry.name,
                email: selectedEntry.email,
                select: selectedEntry.select,
                raceOption: selectedEntry.raceOption,
                comments: selectedEntry.comments
            })
        }
    }, [selectedEntry]);

    const handleCancel = () => {
        setSelectedEntry(null);
    };

    const handleChange = (e) => {
        const value = e.target.value;
        setState({...state, [e.target.name]:value})
    };

    


    //creating the handleSubmit function to submit the form to the backend
    const handleSubmit = (e) => {
            //using axios to call to the backend to create or post a new entry
            e.preventDefault();
            const formData = {
                name: state.name,
                email: state.email,
                select: state.select,
                raceOption: state.raceOption,
                comments: state.comments
            }
            axios.post(url, formData) 
                .then((response) => {
                    //logging the data to the console 
                    console.log(response.data); 
                    refreshList();
                    alert('Form submitted successfully');
                })
                .catch((error) => {
                    
                    console.error(error);
                    alert('An error occurred. Please try again.')
                });
        
    };

    return(
        <form className='form' onSubmit={handleSubmit}>
            <div className='formField'>
                <label className='label'>Name: </label>
                <input className='input' name='name' type='text' value={state.name} onChange={handleChange} ></input>
                
            </div>
            <div className='formField'>
                <label className='label'>Email: </label>
                <input className='input'type='text' name='email' value={state.email} onChange={handleChange}></input>
                
            </div>
            <div className='formField'>
                <label className='label'>Select: </label>
                <select value={state.select} name="select" onChange={handleChange}>
                    <option value=''>Do you want your name on your bib?</option>
                    <option value='Yes'>Yes</option>
                    <option value='No'>No</option>
                </select>
                
            </div>
            <div className='formField'>
            <label className='label'>Choose a Race: </label>
                <label >
                    <input
                        type="radio"
                        onChange={handleChange}
                        name="raceOption"
                        value="5k"
                        checked={state.raceOption === "5k"}
                        
                    />
                    5k
                </label>
                <label >
                    <input
                        type="radio"
                        onChange={handleChange}
                        name="raceOption"
                        value="Half-Marathon"
                        checked={state.raceOption === "Half-Marathon"}

                    />
                    Half-Marathon
                </label>
                <label >
                    <input
                        type="radio"
                        onChange={handleChange}
                        name="raceOption"
                        value="Marathon"
                        checked={state.raceOption === "Marathon"}
                    />
                    Marathon
                </label>
                
            </div>
            <div className='formField'>
                <label className='label'>Comments: </label>
                <textarea className='text-area' name="comments" type='text' value={state.comments} onChange={handleChange}></textarea>
                
            </div>
            <button className='submitButton' type='submit' onSubmit={handleSubmit}>Submit</button>
            <button onClick={handleCancel}>Cancel</button>
        </form>
    )
    
}

export default FormUpdate;
